function Bills({ data, reload }) {
  const [expanded, setExpanded] = useState({});
  const [editing, setEditing] = useState(null);
  const [editForm, setEditForm] = useState({});

  const toggle = (cat) => setExpanded({ ...expanded, [cat]: !expanded[cat] });

  const categories = {
    'Credit Card': { icon: 'ðŸ’³', label: 'Credit Cards', bills: data.bills.filter(b => b.category === 'Credit Card' || b.category === 'Loan') },
    'Rent': { icon: 'ðŸ ', label: 'Rent', bills: data.bills.filter(b => b.category === 'Rent') },
    'Monthly': { icon: 'ðŸ›’', label: 'Monthly Expenses', bills: data.bills.filter(b => ['Utility', 'Personal'].includes(b.category) && b.name !== 'Fundrise') },
    'Investment': { icon: 'ðŸ“ˆ', label: 'Investments', bills: data.bills.filter(b => b.category === 'Investment' || b.name === 'Fundrise') }
  };

  const startEdit = (bill) => {
    setEditing(bill.id);
    setEditForm({ ...bill });
  };

  const saveEdit = async () => {
    try {
      await supabase.from('bills').update({
        default_amount: editForm.varies ? null : +editForm.default_amount || null,
        due_date: +editForm.due_date,
        paid_by: editForm.paid_by,
        payment_method: editForm.payment_method
      }).eq('id', editing);

      setEditing(null);
      setEditForm({});
      reload();
    } catch (error) {
      console.error('Error updating bill:', error);
    }
  };

  const cancelEdit = () => {
    setEditing(null);
    setEditForm({});
  };

  const addBill = async (category) => {
    const name = prompt('Bill name:');
    if (!name) return;

    const amount = prompt('Amount (leave empty if varies):');
    const paymentMethod = category === 'Monthly' ? prompt('Payment method (AMEX, Anseli Checking, etc.):') : null;

    await supabase.from('bills').insert([{
      name,
      default_amount: amount ? +amount : null,
      due_date: 1,
      category: category === 'Monthly' ? 'Personal' : category,
      paid_by: 'Anseli',
      payment_method: paymentMethod,
      varies: !amount,
      active: true
    }]);

    reload();
  };

  return (
    <div>
      <h1 style={s.h1}>Bills Management</h1>

      {Object.entries(categories).map(([key, { icon, label, bills }]) => {
        const total = bills.reduce((sum, b) => sum + (b.default_amount || 0), 0);
        const isExpanded = expanded[key];

        return (
          <div key={key} style={s.expCard}>
            <div style={s.expHeader} onClick={() => toggle(key)}>
              <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
                <span style={{ fontSize: '1.5rem' }}>{icon}</span>
                <div>
                  <div style={{ fontSize: '1.2rem', fontWeight: 600 }}>{label}</div>
                  <div style={{ fontSize: '0.9rem', color: '#999' }}>
                    {bills.length} {bills.length === 1 ? 'item' : 'items'} â€¢ {fmt(total)}/month
                  </div>
                </div>
              </div>
              <span style={{ fontSize: '1.5rem', color: '#4ade80' }}>{isExpanded ? 'âˆ’' : '+'}</span>
            </div>

            {isExpanded && (
              <div style={s.expBody}>
                <table style={s.table}>
                  <thead>
                    <tr>
                      <th style={s.th}>Name</th>
                      <th style={s.th}>Amount</th>
                      <th style={s.th}>Due</th>
                      <th style={s.th}>Paid By</th>
                      {key === 'Monthly' && <th style={s.th}>Payment Method</th>}
                      <th style={s.th}>Actions</th>
                    </tr>
                  </thead>
                  <tbody>
                    {bills.map(bill => {
                      const isEditing = editing === bill.id;

                      return (
                        <tr key={bill.id}>
                          <td style={s.td}>{bill.name}</td>
                          <td style={s.td}>
                            {isEditing && !bill.varies ? (
                              <input 
                                type="number" 
                                step="0.01"
                                value={editForm.default_amount || ''} 
                                onChange={(e) => setEditForm({ ...editForm, default_amount: e.target.value })}
                                style={s.editInput}
                              />
                            ) : (
                              bill.varies ? 'â€”' : fmt(bill.default_amount)
                            )}
                          </td>
                          <td style={s.td}>
                            {isEditing ? (
                              <input 
                                type="number" 
                                min="1" 
                                max="31"
                                value={editForm.due_date} 
                                onChange={(e) => setEditForm({ ...editForm, due_date: e.target.value })}
                                style={s.editInput}
                              />
                            ) : (
                              `${bill.due_date}${bill.due_date === 1 ? 'st' : bill.due_date === 2 ? 'nd' : bill.due_date === 3 ? 'rd' : 'th'}`
                            )}
                          </td>
                          <td style={s.td}>
                            {isEditing ? (
                              <select 
                                value={editForm.paid_by} 
                                onChange={(e) => setEditForm({ ...editForm, paid_by: e.target.value })}
                                style={s.editInput}
                              >
                                <option value="Jorge">Jorge</option>
                                <option value="Anseli">Anseli</option>
                              </select>
                            ) : (
                              <Bdg g={bill.paid_by === 'Anseli'}>{bill.paid_by}</Bdg>
                            )}
                          </td>
                          {key === 'Monthly' && (
                            <td style={s.td}>
                              {isEditing ? (
                                <select 
                                  value={editForm.payment_method || ''} 
                                  onChange={(e) => setEditForm({ ...editForm, payment_method: e.target.value })}
                                  style={s.editInput}
                                >
                                  <option value="">Select...</option>
                                  <option value="AMEX">AMEX</option>
                                  <option value="Jorge Visa">Jorge Visa</option>
                                  <option value="Anseli Visa">Anseli Visa</option>
                                  <option value="Jorge Checking">Jorge Checking</option>
                                  <option value="Anseli Checking">Anseli Checking</option>
                                  <option value="Anseli Bank Account">Anseli Bank Account</option>
                                </select>
                              ) : (
                                <span style={{ fontSize: '0.85rem', color: '#999' }}>{bill.payment_method || 'â€”'}</span>
                              )}
                            </td>
                          )}
                          <td style={s.td}>
                            {isEditing ? (
                              <div style={{ display: 'flex', gap: '0.5rem' }}>
                                <Btn sm onClick={saveEdit}>Save</Btn>
                                <Btn sm sec onClick={cancelEdit}>Cancel</Btn>
                              </div>
                            ) : (
                              <Btn sm onClick={() => startEdit(bill)}>Edit</Btn>
                            )}
                          </td>
                        </tr>
                      );
                    })}
                  </tbody>
                </table>

                {(key === 'Monthly' || key === 'Investment') && (
                  <div style={{ padding: '1rem', borderTop: '1px solid #2d2d2d' }}>
                    <Btn onClick={() => addBill(key)}>+ Add {label === 'Monthly Expenses' ? 'Expense' : 'Investment'}</Btn>
                  </div>
                )}
              </div>
            )}
          </div>
        );
      })}
    </div>
  );
}

