              ))}
            </tbody>
          </table>
        </Card>
      )}
    </div>
  );
}

function Settings({ data, reload }) {
  const [sources, setSources] = useState([]);
  const [saving, setSaving] = useState(false);

  useEffect(() => { setSources(data.income); }, [data]);

  const upd = (id, field, val) => setSources(sources.map(s => s.id === id ? { ...s, [field]: val } : s));

  const save = async () => {
    setSaving(true);
    for (const s of sources) {
      await supabase.from('income_sources').update({ amount: +s.amount, next_pay_date: s.next_pay_date }).eq('id', s.id);
    }
    alert('Saved!');
    setSaving(false);
    reload();
  };

  const tot = sources.reduce((s, i) => s + +i.amount, 0);

  return (
    <div>
      <h1 style={s.h1}>Settings</h1>
      <Card t="Income Sources">
        {sources.map(src => (
          <div key={src.id} style={{ padding: '1.5rem', background: '#0a0a0a', borderRadius: '8px', marginBottom: '1rem' }}>
            <h3 style={{ fontSize: '1.3rem', fontWeight: 600, marginBottom: '1rem', color: '#4ade80' }}>{src.person}</h3>
            <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '1rem' }}>
              <Inp l="Paycheck" type="number" step="0.01" value={src.amount} onChange={(e) => upd(src.id, 'amount', e.target.value)} />
              <Inp l="Next Pay Date" type="date" value={src.next_pay_date} onChange={(e) => upd(src.id, 'next_pay_date', e.target.value)} />
            </div>
            <div style={{ marginTop: '1rem', padding: '1rem', background: '#1a1a1a', borderRadius: '6px' }}>
              <div style={{ fontSize: '0.9rem', color: '#999' }}>Monthly (approx)</div>
              <div style={{ fontSize: '1.5rem', fontWeight: 700, color: '#4ade80' }}>{fmt(+src.amount * 2.17)}</div>
            </div>
          </div>
        ))}
        <div style={{ marginTop: '2rem', padding: '1.5rem', background: '#1a1a1a', borderRadius: '8px', border: '1px solid #4ade80' }}>
          <h3 style={{ fontSize: '1.1rem', fontWeight: 600, marginBottom: '1rem' }}>Combined Income</h3>
          <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '2rem' }}>
            <div>
              <div style={{ fontSize: '0.9rem', color: '#999' }}>Bi-weekly</div>
              <div style={{ fontSize: '1.8rem', fontWeight: 700, color: '#4ade80' }}>{fmt(tot)}</div>
            </div>
            <div>
              <div style={{ fontSize: '0.9rem', color: '#999' }}>Monthly (approx)</div>
              <div style={{ fontSize: '1.8rem', fontWeight: 700, color: '#4ade80' }}>{fmt(tot * 2.17)}</div>
            </div>
          </div>
        </div>
        <div style={{ marginTop: '2rem', textAlign: 'right' }}>
          <Btn onClick={save} disabled={saving}>{saving ? 'Saving...' : 'Save Changes'}</Btn>
        </div>
      </Card>
    </div>
  );
}

